function puzzle25 {
    $tape = [System.Collections.BitArray]::new(10000*2, $false)

    New-Variable 'p' -Value 10000 -Option AllScope
    $stateA = {
        if (!$tape[$p]) {
            $tape[$p] = $true
            ++$p
            return $stateB
        } else {
            $tape[$p] = $false
            --$p
            return $stateE
        }
    }
    $stateB = {
        if (!$tape[$p]) {
            $tape[$p] = $true
            --$p
            return $stateC
        } else {
            $tape[$p] = $false
            ++$p
            return $stateA
        }
    }
    $stateC = {
        if (!$tape[$p]) {
            $tape[$p] = $true
            --$p
            return $stateD
        } else {
            $tape[$p] = $false
            ++$p
            return $stateC
        }
    }
    $stateD = {
        if (!$tape[$p]) {
            $tape[$p] = $true
            --$p
            return $stateE
        } else {
            $tape[$p] = $false
            --$p
            return $stateF
        }
    }
    $stateE = {
        if (!$tape[$p]) {
            $tape[$p] = $true
            --$p
            return $stateA
        } else {
            #$tape[$p] = $false
            --$p
            return $stateC
        }
    }
    $stateF = {
        if (!$tape[$p]) {
            $tape[$p] = $true
            --$p
            return $stateE
        } else {
            #$tape[$p] = $false
            ++$p
            return $stateA
        }
    }

    $state = $stateA
    foreach($n in 1..12208951) {
        $state = & $state
        if ($n % 100000 -eq 0) {
            Write-Host "$n : $p"
        }
    }

    $n = 0
    foreach ($b in $tape) {
        if ($b) { ++$n }
    }
    "Number of set bits: $n"
}
