            ax=[int]$ax; ay=[int]$ay; az=[int]$az;
        }
    }
    $minIdx = -1
    $minA = [int]::MaxValue;
    for ($n = 0; $n -lt $i.Count; ++$n) {
        $p = $i[$n]
        $a = [math]::Abs($p.ax*$p.ax + $p.ay*$p.ay + $p.az*$p.az);
        if ($a -lt $minA) {$minA = $a; $minIdx = $n}
    }
    "Part 1: Index of closest particle in the long run: $minIdx"

    #$i = $i | sort -Property x,y,z
    $tick = 0
    $lastCollision = 0
    while ($i.Count -gt 1 -AND $tick - $lastCollision -lt 100) {
        $g = $i | group -Property x,y,z
        if ($g.Count -ne $i.Count) {
            $lastCollision = $tick
            $i = @($g | ? count -eq 1 | select -ExpandProperty group)
            "Collision at $tick. $($i.Count) particles remain."
        }

        ++$tick
        foreach($p in $i) {
            $p.vx += $p.ax
            $p.vy += $p.ay
            $p.vz += $p.az
            $p.x += $p.vx
            $p.y += $p.vy
            $p.z += $p.vz
        }
    }
    "Part 2: particles remain after collsions: $($i.Count)"
}
