    while(1) {
        ++$step
        $x += $dx
        $y += $dy
        $c = $i[$y][$x]

        if ($c -eq ' ') {
            break
        }
        if ([char]::IsLetter($c)) {
            $path += $c
            continue
        }
        if ($c -eq '+') {
            # turn
            if ($dy -ne 0) {
                # turn right or left
                $r = $i[$y][$x+1]
                $l = $i[$y][$x-1]
                if ($r -eq '-' -OR [char]::IsLetter($r)) {
                    $dir = 'r'
                    $dx,$dy = +1,0
                }
                elseif ($l -eq '-' -OR [char]::IsLetter($l)) {
                    $dir = 'l'
                    $dx,$dy = -1,0
                }
            } else {
                # turn up or down
                $u = $i[$y-1][$x]
                $d = $i[$y+1][$x]
                if ($u -eq '|' -OR [char]::IsLetter($u)) {
                    $dir = 'u'
                    $dx,$dy = 0,-1
                }
                elseif ($d -eq '|' -OR [char]::IsLetter($d)) {
                    $dir = 'd'
                    $dx,$dy = 0,+1
                }
            }
        }
    }
    "Part 1 = $path"
    "Part 2 = $step"
}
