function puzzle18 {
    function input {
        @(
            'set i 31',     #       i = 31
            'set a 1',      #       a = 1
            'mul p 17',     #       p *= 17
            'jgz p p',      #       if (p > 0) goto L1
            'mul a 2',      #       do {   a *= 2
            'add i -1',     #              --i
            'jgz i -2',     #       while (i > 0)
            'add a -1',     #       --a
            'set i 127',    #       i = 127
            'set p 316',    #       p = 316
            'mul p 8505',   #       do {  p *= 8505
            'mod p a',      #             p %= a
            'mul p 129749', #             p *= 129749
            'add p 12345',  #             p += 12345
            'mod p a',      #             p %= a
            'set b p',      #             b = p
            'mod b 10000',  #             b %= 10000
            'snd b',        #             SND b
            'add i -1',     #             --i
            'jgz i -9',     #       while (i > 0)

            'jgz a 3',      #L1:    if (a > 0) goto L3 
            'rcv b',        #L7:    do{    b = RCV
            'jgz b -1',     #       while (b > 0)

            'set f 0',      #L3:    f = 0
            'set i 126',    #       i = 126
            'rcv a',        #       a = RCV
            'rcv b',        #L6:    b = RCV
            'set p a',      #       p = a
            'mul p -1',     #       p *= -1
            'add p b',      #       p += b
            'jgz p 4',      #       if (p > 0) goto L4
            'snd a',        #       SND a
            'set a b',      #       a = b
            'jgz 1 3',      #       goto L5

            'snd b',        #L4:    SND b 
            'set f 1',      #       f = 1
            'add i -1',     #L5:    --i
            'jgz i -11',    #       if (i > 0) goto L6

            'snd a',        #       SND a
            'jgz f -16',    #       if (f > 0) goto L3

            'jgz a -19'     #       if (a > 0) goto L7
        )
    }
    
    $i = @(input | %{
        $op,$x,$y = $_ -split ' '
        [pscustomobject]@{op=$op; x=$x; y=$y;}
    })

    # init registers
    $defaultRegisters = @{}
    $i | %{
        if ([char]::IsLetter($_.x[0])) { $defaultRegisters[$_.x] = 0 }
        if ($_.y -AND [char]::IsLetter($_.y[0])) { $defaultRegisters[$_.y] = 0 }
    }
    
    function part1 {
        $registers = $defaultRegisters.Clone()
        $freq = -1
        $pos = 0
        while($pos -lt $i.Count) {
            $inst = $i[$pos]
            $regX = $inst.x
            $regY = $inst.y
            $x = if ([char]::IsLetter($regX[0])) { $registers[$regX] } else { [int]$regX }
            $y = if ($regY -AND [char]::IsLetter($regY[0])) { $registers[$regY] } else { [int]$regY }

            $jmp = 1
            switch ($inst.op) {
                'set' { $registers[$regX] = $y; break}
                'add' { $registers[$regX] = $x + $y; break}
                'mul' { $registers[$regX] = $x * $y; break}
                'mod' { $registers[$regX] = $x % $y; break}
                'jgz' { if ($x -gt 0) { $jmp = $y }; break}
                'snd' { $freq = $x; break}
                'rcv' {
                    if ($x -ne 0) {
                        return $freq
                    }
                    break
                }
            }
            $pos += $jmp
        }
    }
    "Part 1: Frequency at first non-zero RCV: $(part1)"

    New-Variable 'prog1SendCnt' -value 0 -Option AllScope
    function run([int]$progId, [int]$pos, $registers, $rcv, $snd) {
        # Execute until we reach the end, or the recieve queue is empty
        while ($pos -lt $i.Count) {
            $inst = $i[$pos]
            $regX = $inst.x
            $regY = $inst.y
            $x = if ([char]::IsLetter($regX[0])) { $registers[$regX] } else { [long]$regX }
            $y = if ($regY -AND [char]::IsLetter($regY[0])) { $registers[$regY] } else { [long]$regY }

            #if ($pos -eq 23) {
            #    Write-Host "  P${progId}: IP=$pos`tREG:[$(($registers.GetEnumerator()|%{$_.Key+'='+$_.Value}) -join "`t")]"
            #}
    
            $jmp = 1
            switch ($inst.op) {
                'set' { $registers[$regX] = $y; break}
                'add' { $registers[$regX] = $x + $y; break}
                'mul' { $registers[$regX] = $x * $y; break}
                'mod' { $registers[$regX] = $x % $y; break}
                'jgz' { if ($x -gt 0) { $jmp = $y }; break}
                'snd' {
                    # send to other program
                    $snd.Enqueue($x)
                    if ($progId -eq 1) {
                        ++$prog1SendCnt
                    }
                    break
                }
                'rcv' {
                    if ($rcv.Count -eq 0) {
                        # wait for other program to SND
                        return $pos
                    }
                    $registers[$regX] = $rcv.Dequeue()
                    break
                }
            }
            $pos += $jmp
        }
        Write-Host "  P${progId} terminated. REG:[$(($registers.GetEnumerator()|%{$_.Key+'='+$_.Value}) -join "`t")]"
        return $i.Count # complete
    }

    $registers0 = $defaultRegisters.Clone()
    $registers1 = $defaultRegisters.Clone()
    $registers0['p'] = 0
    $registers1['p'] = 1
    $queue0 = [Collections.Queue]::new()
    $queue1 = [Collections.Queue]::new()
    $pos0 = 0
    $pos1 = 0
    $loopCnt = 0
    while($true) {
        ++$loopCnt
        $pos0 = run 0 $pos0 $registers0 $queue0 $queue1
        $pos1 = run 1 $pos1 $registers1 $queue1 $queue0

        if (($pos0 -ge $i.Count -OR $queue0.Count -eq 0) -AND
            ($pos1 -ge $i.Count -OR $queue1.Count -eq 0)) {
            # both are complete or waiting for input from other (deadlocked)
            "Part 2: Number of times Program 1 sent a value: $prog1SendCnt"
            break
        }

        if ($loopCnt % 10000 -eq 0) { "[$loopCnt]" }
    }
}
