function puzzle17 {
    $step = 343

    $buf = New-Object 'System.Collections.Generic.List[Int]'
    $buf.Add(0)
    $pos = 0
    foreach ($n in (1..2017)) {
        $pos = (($pos + $step) % $buf.Count) + 1
        $buf.Insert($pos, $n)
    }
    'Part 1 = ' + $buf[$pos+1]

    $part2 = -1
    $pos = 0
    foreach ($n in 1..50000000) {
        $pos = (($pos + $step) % $n) + 1;
        # $buf.Insert($pos, $n)
        if ($pos -eq 1) {
            $part2 = $n
        }
    }
    'Part 2 = ' + $part2
}
