        if ($_ % 1000000 -eq 0) { "[$_ = $count]" }
    }
    "Part 1 = $count"

    $count = 0
    (1..5000000) | %{
        do {
            $null = [math]::DivRem($A * 16807, 2147483647, [ref]$rem)
            $A = $rem
        } while ($A % 4 -ne 0)
        do {
            $null = [math]::DivRem($B * 48271, 2147483647, [ref]$rem)
            $B = $rem
        } while ($B % 8 -ne 0)
    
        #"A: $A"
        #"B: $B"
        #""

        if (($A -band 0x0000ffff) -eq ($B -band 0x0000ffff)) {
            ++$count
        }
        if ($_ % 1000000 -eq 0) { "[$_ = $count]" }
    }
    "Part 2 = $count"
    
}
