function puzzle14 {
    function hash([string]$s) {
        $lengths = @($s.GetEnumerator() | % { [int][char]$_ }) + @(17, 31, 73, 47, 23)

        $values = (0..255)
        $skip, $p = (0, 0);
        foreach ($round in 0..63) {
            foreach ($len in $lengths) {
                $mid = [int]($len / 2)
                for ($i = 0; $i -lt $mid; ++$i) {
                    $n = $p + $i
                    $m = $p + $len - 1 - $i
                    # swap $n $m
                    $temp = $values[$m % 256]
                    $values[$m % 256] = $values[$n % 256]
                    $values[$n % 256] = $temp
                }

                $p += $len + $skip
                ++$skip
            }
        }

        $hash = ''
        $h = 0
        foreach ($n in (0..255)) {
            $h = $h -bxor $values[$n]
            if (($n + 1) % 16 -eq 0) {
                $hash += '{0:x2}' -f $h
                $h = 0
            }
        } 
        $hash
    }

    $grid = [array]::CreateInstance([int], 128 * 128)
    function get([int]$x, [int]$y) { $grid[$y * 128 + $x] }
    function put([int]$x, [int]$y, [int]$v) { $grid[$y * 128 + $x] = $v }
    function dump($XExtent = 7, $YExtent = 7) {
        foreach ($y in 0..$YExtent) {
            $accum = ''
            foreach ($x in 0..$XExtent) {
                $accum += '{0,3}  ' -f (get $x $y)
            }
            write-host $accum -ForegroundColor DarkGray
        }
        write-host '' -ForegroundColor DarkGray
    }

    foreach ($y in 0..127) {
        $in = "ugkiagan-$y" # flqrgnkx (8108)
        $hash = hash $in
        # "$in = $hash"
        $x = 0
        foreach($c in $hash.GetEnumerator()) {
            $n = [int]::Parse($c, [Globalization.NumberStyles]::HexNumber)
            foreach($m in (8,4,2,1)) {
                $v = if ($n -band $m) {-1} else {0}
                put $x $y $v
                ++$x
            }
        }
    }
    dump 7 15

    function flood([int]$x, [int]$y, [int]$v) {
        put $x $y $v
        flood_right $x $y $v
        flood_down $x $y $v
        flood_left $x $y $v
        flood_up $x $y $v
    }
    function flood_right([int]$x, [int]$y, [int]$v) {
        while(++$x -lt 128 -AND (get $x $y) -eq -1) {
            flood $x $y $v
        }
    }
    function flood_down([int]$x, [int]$y, [int]$v) {
        while(++$y -lt 128 -AND (get $x $y) -eq -1) {
            flood $x $y $v
        }
    }
    function flood_left([int]$x, [int]$y, [int]$v) {
        while(--$x -ge 0 -AND (get $x $y) -eq -1) {
            flood $x $y $v
        }
    }
    function flood_up([int]$x, [int]$y, [int]$v) {
        while(--$y -ge 0 -AND (get $x $y) -eq -1) {
            flood $x $y $v
        }
    }
    $regions = 0
    foreach ($y in 0..127) {
        foreach ($x in 0..127) {
            if (($v = get $x $y) -ne -1) {
                continue
            }
            
            ++$regions
            flood $x $y $regions
        }
    }

    dump 7 15
    $regions
}
