    function steps($x, $y) {
        $x = [math]::Abs($x)
        $y = [math]::Abs($y)
        $diag = $x / 3;
        $down = [math]::Max(($y - ($diag * 2)), 0) / 4;
        $diag + $down
    }

    $x,$y = 0,0
    $maxx,$maxy = 0,0
    input | %{
        switch ($_) {
            'nw' { $x += -3; $y += +2; break}
            'n'  { $x += +0; $y += +4; break}
            'ne' { $x += +3; $y += +2; break}
            'se' { $x += +3; $y += -2; break}
            's'  { $x += +0; $y += -4; break}
            'sw' { $x += -3; $y += -2; break}
        }
        $maxx = [math]::Max([math]::Abs($x), $maxx);
        $maxy = [math]::Max([math]::Abs($y), $maxy);
    }
    "Part 1: (x=$x,y=$y) = $(steps $x $y) steps."
    "Part 2: (x=$maxx,y=$maxy) = $(steps $maxx $maxy) steps."
}
