    $i = input | %{
        if ($_ -match '^(\w+) \((\d+)\)(?: -> (.*))?$') {
            [pscustomobject]@{
                name = $Matches[1];
                weight = [int]$Matches[2];
                children = @($Matches[3] -split ', ')
                totalWeight = 0;
            }
        }
    }

    $lookup = @{}
    $i | %{ $lookup[$_.name] = $_ }
    $i | %{ $_.children = $_.children | %{ $lookup[$_] }}

    # Part 1
    $childParentMap = @{}
    foreach($item in $i) {
        foreach($child in $item.children) {
            $childParentMap[$child.name] = $item
        }
    }
    $root = $i | ?{ !$childParentMap.ContainsKey($_.name) }
    "Root = " + $root.name
    
    # Part 2
    function assignTotalWeight($item) {
        $totalWeight = $item.totalWeight
        if ($totalWeight -eq 0) {
            $totalWeight = $item.weight
            foreach($child in $item.children) {
                $totalWeight += assignTotalWeight $child
            }
            $item.totalWeight += $totalWeight
        }
        $totalWeight
    }
    $null = assignTotalWeight $root

    function dump ($item, [int]$depth = 0) {
        write-host (' ' * $depth) -NoNewline
        write-host ("{0}({1})" -f $item.name,$item.weight) -NoNewline
        write-host " -> " -NoNewline
        $item.children | %{ write-host ("{0}({1}) " -f $_.name,$_.totalweight) -NoNewline }
        write-host
    } 
    function findUnbalanced($item, [int]$depth = 0) {
        # Assumes $item contains 0 or 1 unbalanced child
        dump $item $depth
        if (!$item.children) { return }
        
        # Find the child(ren) with unique totalWeights.
        $unbalanced = @($item.children | group totalWeight | ? Count -eq 1 | %{$_.Group})
        switch ($unbalanced.Length) {
            0 {
                # children are balanced
                return
            }
            1 {
                # check if the unbalance is in grandchild...
                if ($result = findUnbalanced $unbalanced[0] ($depth+1)) {
                    return $result
                }
                # the grandchildren are balanaced, thus this child must have incorrect weight.
                return $unbalanced[0]
            }
            2 {
                # This can occur when contains exactly two children and one is unbalanced.
                # In this case we can't know which is unbalanced so we must assume the
                # unbalance is via a grandchild.
                if ($result = findUnbalanced $unbalanced[0] ($depth+1)) {
                    return $result
                }
                if ($result = findUnbalanced $unbalanced[1] ($depth+1)) {
                    return $result
                }
                throw "Found ambiguous unbalanced children"
            }
            default {
                throw "Found multiple unbalanced children"
            }
        }
    }

    $unbalanced = findUnbalanced $root
    dump $unbalanced
  
    $weights = $childParentMap[$unbalanced.name].children | group totalWeight | sort Count | %{[int]$_.Name}
    if ($weights.Length -ne 2) { throw "Didnt find difference." }
    "Weight should be " + ($unbalanced.Weight + ($weights[1] - $weights[0]))
}
