function puzzle6 {
    function input{
        @(4,1,15,12,0,9,9,5,5,8,7,3,14,5,12,3)
    }

    $i = @(input)
    $step = 0
    $m = @{}

    $m[($i -join ',')] = $step
    while (1) {
        ++$step

        $n = 0
        for ($j = 0; $j -lt $i.Length; ++$j) {
            if ($i[$j] -gt $i[$n]) { $n = $j }
        }

        $count = $i[$n]
        $i[$n] = 0
        while ($count -gt 0) {
            ++$n
            ++$i[$n % $i.count]
            --$count
        }

        $state = $i -join ','
        if ($m.ContainsKey($state)) {
            $m.Count
            $step - $m[$state]
            break;
        }
        $m[$state] = $step
    }
}
