function puzzle3b {
    $target = 347991
    $m = @{}
    function calc([int]$x,[int]$y) {
        $v = 0
        $v += $m["$($x+1),$($y+0)"]
        $v += $m["$($x-1),$($y+0)"]
        $v += $m["$($x+0),$($y+1)"]
        $v += $m["$($x+0),$($y-1)"]
        $v += $m["$($x+1),$($y+1)"]
        $v += $m["$($x+1),$($y-1)"]
        $v += $m["$($x-1),$($y+1)"]
        $v += $m["$($x-1),$($y-1)"]
        $m["$x,$y"] = $v
        "$x,$y = $v"
        if ($v -gt $target) {
            throw "$v"
        }
    }

    $m["0,0"] = 1
    "0,0 = 1"
    $x,$y = 1,0
    try {
        foreach ($shell in (1..10))
        {
            for (; $y -lt $shell; ++$y)  { calc $x $y }
            for (; $x -gt -$shell; --$x) { calc $x $y }
            for (; $y -gt -$shell; --$y) { calc $x $y }
            for (; $x -le $shell; ++$x)  { calc $x $y }
        }
    } catch {
        $_.Exception.Message
    }
}
